import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function ForgotPassword() {
    const [email, setEmail] = useState("");
    const [foundUser, setFoundUser] = useState(null);
    const [message, setMessage] = useState("");
    const [error, setError] = useState("");
    const [loading, setLoading] = useState(false);
    const [newPassword, setNewPassword] = useState("");
    const [confirmPassword, setConfirmPassword] = useState("");
    const navigate = useNavigate();

    const handleCheckEmail = (e) => {
        e.preventDefault();
        setError("");
        setMessage("");
        setLoading(true);

        // UI-only flow: accept any email and move to reset step
        setTimeout(() => {
            setFoundUser({ id: "demo", email });
            setMessage("‚úÖ Demo mode: please enter a new password.");
            setLoading(false);
        }, 300);
    };

    // Step 2: Update password
    const handleChangePassword = (e) => {
        e.preventDefault();
        setError("");
        setMessage("");

        if (!newPassword || !confirmPassword) {
            setError("Please enter complete password!");
            return;
        }

        if (newPassword !== confirmPassword) {
            setError("‚ùå Password confirmation does not match!");
            return;
        }

        // UI-only success flow
        setMessage("‚úÖ Password updated (demo). Returning to login...");
        setTimeout(() => navigate("/login"), 1500);
    };

    return (
        <div className="container mt-5" style={{ maxWidth: "400px" }}>
            <h3 className="text-center mb-4">üîê Forgot Password</h3>

            {!foundUser ? (
                <form onSubmit={handleCheckEmail}>
                    <div className="mb-3">
                        <label className="form-label">Registered Email</label>
                        <input
                            type="email"
                            className="form-control"
                            placeholder="Enter your email..."
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            required
                        />
                    </div>

                    {error && <div className="alert alert-danger">{error}</div>}
                    {message && <div className="alert alert-success">{message}</div>}

                    <button
                        type="submit"
                        className="btn btn-primary w-100"
                        disabled={loading}
                    >
                        {loading ? "Checking..." : "Continue"}
                    </button>

                    <p className="text-center mt-3">
                        <button
                            type="button"
                            className="btn btn-link p-0"
                            onClick={() => navigate("/login")}
                            style={{ color: "#007bff", textDecoration: "none", border: "none", background: "none" }}
                        >
                            Back to login
                        </button>
                    </p>
                </form>
            ) : (
                <form onSubmit={handleChangePassword}>
                    <div className="mb-3">
                        <label className="form-label">New Password</label>
                        <input
                            type="password"
                            className="form-control"
                            placeholder="Enter new password..."
                            value={newPassword}
                            onChange={(e) => setNewPassword(e.target.value)}
                            required
                        />
                    </div>

                    <div className="mb-3">
                        <label className="form-label">Confirm Password</label>
                        <input
                            type="password"
                            className="form-control"
                            placeholder="Re-enter password..."
                            value={confirmPassword}
                            onChange={(e) => setConfirmPassword(e.target.value)}
                            required
                        />
                    </div>

                    {error && <div className="alert alert-danger">{error}</div>}
                    {message && <div className="alert alert-success">{message}</div>}

                    <button type="submit" className="btn btn-success w-100" style={{ color: "#007bff", textDecoration: "none", border: "none", background: "none" }} >
                        Change Password
                    </button>
                </form>
            )}
        </div>
    );
}

export default ForgotPassword;
